    [],nt"revision_timestamp": "2016-07-27T22:41:55.415763",nt"name": "contaminants-survey-of-la-sal-vieja-willacy-county-texas-1989",nt"isopen":
    false,nt"url": null,nt"notes": "Organochlorine, trace element, and petroleum
    hydrocarbon contaminants were examined in sediments from two hypersaline lakes comprising
    the La Sal Vieja complex in Willacy County, Texas, and from sediment and biota in
    a slightly brackish drain nearby. One of the lakes, East Lake, has been impacted
    by considerable oil and gas production, and this was reflected in moderately higher
    levels of most contaminants in sediments. Polynuclear aromatic hydrocarbons were
    detected at low levels in sediment samples, and high levels of chromium, copper,
    nickel, zinc, and breakdown products of organochlorine pesticides (up to 1.4 ppm
    wet weight DDE) were detected in fish samples from the Salt Drain nearby. The high
    DDE levels may pose a threat of eggshell thinning in fish eating birds. Periodic
    monitoring of heavy metal and DDE levels in fish is recommended.",nt"license_title":
